This is not my usual post looking to give hope to people, this more of a talking to myself.

I hid my problems, I sacrificed time, I took my best face out despite every bad thing that could happen, i looked for things to dristract you from you problems, I stayed positive about life even though I felt like shit, just for you to feel like i believed in you.

And you just disappear, everyone tells me to be patient, that you may have your reasons, that you may have problems, but I guess I need to face the truth, you got bored, you never wanted me as anything but a way to spend some time, you tried but you couldn't see me as anything but a stranger.

And it's ok, I don't blame you, you were always a closed heart person, it's my fault for having faith, love and trust in you.

This just me walking into pain willingly.

And now it hurts not knowing anything, I can't help but to worry, are you ok? Are you happy? Do you even care? Why is it that if you don't care I care? How can I stop caring?...

Fuck I hate myself...
